import React from 'react';
import List from '@mui/material/List';
import Divider from '@mui/material/Divider';
import { mainListItems, secondaryListItems } from './listitems';

function Orders() {
  return (
    <div>
      <List component="Navigation">
            {mainListItems}
            <Divider sx={{ my: 1 }} />
            {secondaryListItems}
          </List>
    </div>
  )
}

export default Orders
